import React from "react";
import { useSelector } from "react-redux";

import { InfoBlock } from "../../components/ui/index";

import { pencil } from "../../assets/index";

import "./styles.css";
import SideNav from "../../components/routes/sideNav";

const Account = () => {
  const { fullName, email, avatarUrl } = useSelector(
    (state) => state.auth.data
  );

  const personalData = [fullName, email];
  const addressData = [];

  return (
    <div className="account-container">
      <SideNav avatar={avatarUrl} />
      <div className="middle">
        <InfoBlock
          height={30 + "vh"}
          data={personalData}
          section={"Presonal Data"}
        />
        <div className="shipping-info">
          <InfoBlock
            height={50 + "vh"}
            data={addressData}
            section={"My shipping addresses"}
          >
            <button>Add new address</button>
          </InfoBlock>
        </div>
        <div className="password-info">
          <h1>Change Password</h1>
          <div className="password">**********</div>
        </div>
      </div>
      <div className="right">
        <div className="def-shipping">
          <h1>Default Shipping</h1>
          <div>None</div>
        </div>
        <div className="shipping-method">
          <h1>Default Shipping Method</h1>
          <div>None</div>
        </div>
      </div>
    </div>
  );
};

export default Account;
